import { useState } from "react"
import Nav from "../components/Nav"
import { useCookies } from "react-cookie"
import axios from "axios"
import { useNavigate } from "react-router-dom"
import 'react-multiple-select-dropdown-lite/dist/index.css'

const EditUser = () => {

    let navigate = useNavigate()

    const [cookies, setCookie, removeCookie] = useCookies(["user"])
    const [inputList, setinputList] = useState([{ protitle: '', prodes: '' }]);
    const [editUser, seteditUser] = useState({
        user_id: cookies.UserId,
        university: "",
        githublink: "",
        linkedinlink: [],
        YOE: "",
        bio: "",
    })

    const [formData, setFormData] = useState({
        user_id: cookies.UserId,
        name: "",
        field: "",
        skill: [],
        work: "",
        url: "",
        phone_number: "",
        matches: []
    })


    const handleChange = (e) => {
        console.log("e", e)
        const value = e.target.value
        const name = e.target.name

        seteditUser((prevState) => ({ ...prevState, [name]: value }))
    }

    const handleinputchange = (e, index) => {
        const { name, value } = e.target;
        const list = [...inputList];
        list[index][name] = value;
        setinputList(list);

    }

    const handleremove = index => {
        const list = [...inputList];
        list.splice(index, 1);
        setinputList(list);
    }

    const handleaddclick = () => {
        setinputList([...inputList, { protitle: '', prodes: '' }]);
    }

    const handleSubmit = async (e) => {
        console.log("clicked here")
        e.preventDefault()
        console.log(editUser)
        console.log(inputList)
        try {
            const response = await axios.put("http://localhost:8000/editUser", {
                editUser,
                inputList
            })
            const success = response.status === 200

            if (success) navigate("/dashboard")
        } catch (err) {
            console.log(err)
        }
    }

    const handleExit = (e) => {
        e.preventDefault()
        navigate("/dashboard")
    }


    return (
        <>
            <Nav minimal={true} setShowModel={() => { }} showModel={false} />

            <div className="editUser">
                <h2>User Details</h2>

                <form onSubmit={handleSubmit}>
                    <section>
                        <label htmlFor="name">Name</label>
                        <input
                            id="name"
                            type="text"
                            name="name"
                            placeholder="Enter Name"
                            required={true}
                            value={formData.name}
                            onChange={handleChange}
                        />


                        <label>Field</label>
                        <div className="multiple-input-container">
                            <input
                                id="frontend-identity"
                                type="radio"
                                name="field"
                                value="frontend"
                                onChange={handleChange}
                                checked={formData.field === "frontend"}
                            />
                            <label htmlFor="frontend-identity">FrontEnd</label>
                            <input
                                id="backend-identity"
                                type="radio"
                                name="field"
                                value="backend"
                                onChange={handleChange}
                                checked={formData.field === "backend"}
                            />
                            <label htmlFor="backend-identity">BackEnd</label>
                            <input
                                id="fullstack-identity"
                                type="radio"
                                name="field"
                                value="fullstack"
                                onChange={handleChange}
                                checked={formData.field === "fullstack"}
                            />
                            <label htmlFor="fullstack-identity">FullStack</label>
                        </div>

                        <div className="skill">Skill</div>

                        <div className="multi">

                            <Select
                                isMulti
                                name="colors"
                                options={options}
                                className="basic-multi-select"
                                classNamePrefix="select"
                                onChange={handleChange2}
                            />
                        </div>

                        <label htmlFor="work">Work / Profession</label>
                        <input
                            id="work"
                            type="text"
                            name="work"
                            placeholder="Enter Profession"
                            required={true}
                            value={formData.work}
                            onChange={handleChange}
                        />
                        <label htmlFor="phone_number">Phone Number</label>
                        <input
                            id="phone_number"
                            type="text"
                            name="phone_number"
                            placeholder="Enter Phone Number"
                            required={true}
                            value={formData.phone_number}
                            onChange={handleChange}
                        />
                        <input className="submit-button" type="submit" />
                    </section>
                    <section>
                        <label htmlFor="about">Profile Photo</label>
                        <input
                            id="url"
                            type="url"
                            name="url"
                            required={true}
                            value={formData.url}
                            onChange={handleChange}
                        />
                        <div className="photo-container">
                            {formData.url && <img src={formData.url} alt="pic preview" />}
                        </div>
                    </section>
                    <section>
                        <label htmlFor="university">University</label>
                        <input
                            id="university"
                            type="text"
                            name="university"
                            placeholder="Enter University"
                            required={true}
                            value={editUser.university}
                            onChange={handleChange}
                        />

                        <label htmlFor="githublink">Github </label>
                        <input
                            id="githublink"
                            type="text"
                            name="githublink"
                            placeholder="Enter Github Link"
                            required={true}
                            value={editUser.githublink}
                            onChange={handleChange}
                        />
                        <label htmlFor="linkedinlink">LinkedIn </label>
                        <input
                            id="linkedinlink"
                            type="text"
                            name="linkedinlink"
                            placeholder="Enter LinkedIn Link"
                            required={true}
                            value={editUser.linkedinlink}
                            onChange={handleChange}
                        />
                        <label htmlFor="YOE">Years of Experience</label>
                        <input
                            id="YOE"
                            type="number"
                            name="YOE"
                            placeholder="Years"
                            required={true}
                            value={editUser.YOE}
                            onChange={handleChange}
                        />
                        <input className="submit-button" type="submit" />
                    </section>
                    <section>
                        <label htmlFor="bio">Short Bio</label>
                        <input
                            id="bio"
                            type="text"
                            name="bio"
                            required={true}
                            placeholder="Enter Bio"
                            value={editUser.bio}
                            onChange={handleChange}
                        />
                        <div className="project">
                            {
                                inputList.map((x, i) => {
                                    return (
                                        <div>
                                            <div>
                                                <label >Project Title</label>
                                                <input
                                                    type="text"
                                                    name="protitle"
                                                    placeholder="Enter Project Name"
                                                    onChange={e => handleinputchange(e, i)} />
                                            </div>
                                            <div>
                                                <label >Project Description</label>
                                                <input
                                                    type="text"
                                                    name="prodes"
                                                    placeholder="Enter Project Details"
                                                    onChange={e => handleinputchange(e, i)} />
                                            </div>

                                            {
                                                inputList.length !== 1 &&
                                                <button onClick={() => handleremove(i)}>Remove</button>
                                            }
                                            {inputList.length - 1 === i &&
                                                <button onClick={handleaddclick}>Add More</button>
                                            }
                                        </div>
                                    );
                                })}
                        </div>
                    </section>
                </form>
                <button className="back-button" onClick={handleExit}>Go Back!</button>
            </div >

        </>
    )
}

export default EditUser
